import './App.css';
import Tasks from './components/Tasks';
import TasksDone from './components/TasksDone'


function App() {
  return (
    <div className="App">
        <header>
        <h1>TaskList</h1>
        <div className="input__task">
            <input type="text" placeholder="Add new task"></input>
            <button type="button">Add</button>
        </div>
      </header>
      <Tasks/>
      <TasksDone/>
    </div>
  );
}

export default App;
